import './App.css';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import Classrooms from './Components/Templates/Classrooms';
import { Classroom } from './Components/Assets/Classroom/Classroom';
import Home from './Assets/Classroom/Home/Home';
import Profile from './Assets/Classroom/Profile/Profile';
import Modules from './Assets/Classroom/Modules/Modules';
import Courses from './Assets/Classroom/Courses/Courses';
import Grades from './Assets/Classroom/Grades/Grades';
import Tasks from './Assets/Classroom/Tasks/Tasks';
import Settings from './Assets/Classroom/Settings/Settings';

function App() {
  return (
      <Routes>
        <Route path='/' element={<Classrooms />} />
        <Route path="/classroom" element={<Classroom />}>
        <Route path="home" element={<h1>Welcome to Home</h1>} />
        <Route path="profile" element={<h1>Profile Page</h1>} />
        <Route path="modules" element={<h1>Modules Page</h1>} />
        <Route path="courses" element={<h1>Courses Page</h1>} />
        <Route path="grades" element={<h1>Grades Page</h1>} />
        <Route path="tasks" element={<h1>Tasks Page</h1>} />
        <Route path="settings" element={<h1>Settings Page</h1>} />
      </Route>
      </Routes>
  );
}

export default App;
